import React, {useState} from 'react'
import { Link, useNavigate } from "react-router-dom";
import './Login.css'

function Login({ authenticate }) {
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");

  const loginName = {
    loginName: name
  }

  function findLoginDataInBackend () {
    fetch("http://localhost:3002/login" , {
      method: "POST",
      headers: { "Content-Type": "application/json"},
      body: JSON.stringify(loginName)
  })
  .then((response) => response.json())
  .then((data) => {
      for(entries of data.urls) {
          const allEntrys = document.getElementById("allEntrys");
          const liELement = document.createElement("li");

          liELement.innerHTML = entries.short + ", " + entries.long;
          allEntrys.appendChild(liELement);
      }
  })
  }
  return (
    <section className='login'>
      <form>
      <h1 style={{color: "white"}}>Please Login</h1>
        <div>
          <label for="name">Name</label>
          <input type="text" id="name" name="name" onChange={(e) => setName(e.target.value)} required/>
        </div>
        <div>
          <label for="password">Password</label>
          <input type="password" id="password" name="password" onChange={(e) => setPassword(e.target.value)} required/>
        </div>
        <div>
          <label></label>
          <input type="submit" onClick={findLoginDataInBackend}></input>
        </div>
        <Link to="/register">Not registerd?</Link>
      </form>
    </section>
  )
}

export default Login;
